import React, {Component} from 'react'
import Character from './Character'
import {withCharacter} from './MyProvider'

class CharContainer extends Component {
    componentDidMount(){
        this.props.getSingleCharacter()
    }

    render(){
        return(
            <div className='charContainer'>
                <Character name={this.props.char.name} alias={this.props.char.alias} house={this.props.char.house} />
            </div>
        )
    }
}

export default withCharacter(CharContainer)
